The FIM World Enduro Championship (WEC) is the world championship series for enduro, a popular form of off-road motorcycle sport. The championship currently features three classes (E1, E2 and E3), along with separate categories for junior and female riders. The WEC was first organized in 1990, and currently consists of 14 races based on seven two-day events (there was supposed to be 8 events but Mexico has been cancelled for 2014). All rounds include an enduro test, a motocross test and an extreme test.

